import React from 'react'
import {Link, useHistory} from 'react-router-dom'

const {push} = useHistory();



const handleDelete = e => {
    axiosWithAuth().delete(`/api/trucks/${props.id}`)
    .then(res =>{
        console.log(res);
        push('/Operator/DashBoard')

    })
    .catch (err =>{
        console.log(err,'no data coming in')
    })
}

export default function OpTruckCard(props) {
    return (
        <div className='truckCard'>
            <h1>{props.truckName}</h1>
            <img alt='food truck pic' src={props.image}/>
            <p>{props.location}</p>
            <p>{props.departTime}</p>
            <div>
            <button>Update</button>
            <button on Click={handleDelete} >Delete</button>
            </div>
        </div>
    )
}
